namesraw = ""
surnamesraw = "&"
names = namesraw.split("+")
surnames = surnamesraw.split("+")
def pinterest_profile_generator (names, surnames):

    keywordlist = ("Food", "Pets", "Makeup", "Design", "Sport", "Photo", "Art", "Fashion", "Trash", "Motorsport", "Fun", "Candy", "DHDK")
    vanilla_string = '@prefix uomoprofile: <http://uomodhdk.github.io/Ontology/uomoprofile.owl#> . \n @prefix foaf: <http://xmlns.com/foaf/0.1/> . \n @prefix time: <http://www.w3.org/2006/time> . \n @prefix terms: <http://purl.org/dc/terms/> . \n @prefix schema: <http://schema.org/> . \n @prefix xsd: <http://www.w3.org/2001/XMLSchema#> . \n @prefix dc: <http://purl.org/dc/elements/1.1/> . \n @prefix sioc: <http://www.w3.org/2003/06/sw-vocab-status/ns#> . \n @prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> . \n @prefix : <profilelinkhere> . \n \n \n #User \n \n :user \n a sioc:UserAccount ; \n uomoprofile:creates <profilelinkhere> ; \n uomoprofile:has_nickname :nickname . \n \n \n #Nickname \n \n :nickname \n a uomoprofile:Nickname ; \n uomoprofile:is_nickname_of :user ; \n foaf:nick "nicknamehere"^^rdfs:Literal . \n \n \n #ProfilePic \n \n <imagelinkhere> \n a uomoprofile:Profile_Media ; \n uomoprofile:is_main_media_of <profilelinkhere> . \n \n \n #Numoffollower \n \n :numoffollower \n a uomoprofile:Number_of_followers ; \n uomoprofile:is_a_stat_of <profilelinkhere> ; \n uomoprofile:value "numfollowerhere"^^xsd:nonNegativeInteger . \n \n \n #Numoffollowing \n \n :numoffollowing \n a uomoprofile:Number_of_following ; \n uomoprofile:is_a_stat_of <profilelinkhere> ; \n uomoprofile:value "numfollowing"^^xsd:nonNegativeInteger . \n \n \n #ActualPlace \n \n :ActualPlace \n a uomoprofile:Actual_Place ; \n uomoprofile:value "placenamehere"^^xsd:string; . \n \n \n #FullName \n \n :FullName \n a uomoprofile:Biographical_Info ; \n uomoprofile:fullname "fullnamehere"^^rdfs:Literal . \n \n \n #Followers \n \n :followers \n a uomoprofile:Followers ; \n uomoprofile:is_container_of <profilelinkhere> . \n \n \n #Following \n \n :following \n a uomoprofile:Following ; \n uomoprofile:is_container_of <profilelinkhere> . \n \n \n #Boards \n \n :boards \n a uomoprofile:Content_Container ; \n uomoprofile:is_container_of <profilelinkhere> ; \n uomoprofile:has_displaying_order orderhere ; \n uomoprofile:contains :containername1, :containername2, :containername3, :containername4. \n \n \n #Pins \n \n :pins \n a uomoprofile:Content_Container ; \n uomoprofile:is_container_of <profilelinkhere> . \n \n \n #Tried \n \n :tried \n a uomoprofile:Content_Container ; \n uomoprofile:is_container_of <profilelinkhere> . \n \n \n #Topics \n \n :topics \n a uomoprofile:Interest_Container ; \n uomoprofile:is_container_of <profilelinkhere> . \n \n \n #containername1 \n \n :containername1 \n a uomoprofile:Content_Container . \n \n \n #containername2 \n \n :containername2 \n a uomoprofile:Content_Container . \n \n \n #containername3 \n \n :containername3 \n a uomoprofile:Content_Container . \n \n \n #containername4 \n \n :containername4 \n a uomoprofile:Content_Container . \n \n \n #Profile \n \n : \n a uomoprofile:User_Profile ; \n uomoprofile:created_by :user ; \n uomoprofile:uri "profilelinkhere"^^xsd:anyURI ; \n uomoprofile:has_main_media <imagelinkhere> ; \n uomoprofile:has_stats :numoffollower, :numoffollowing ; \n uomoprofile:has_privacy privacyhere ; \n uomoprofile:bio "fakebio"^^xsd:string ; \n uomoprofile:has_biographical_info :ActualPlace, :FullName ; \n uomoprofile:has_container :followers, :following, :boards, :pins, :tried, :topics . \n'
    order = ['uomoprofile:Popularity_Order_Normal', 'uomoprofile:Chronological_Order_new_to_old',
             'uomoprofile:Chronological_Order_Normal', 'uomoprofile:Alphabetical_Order_Normal',
             'uomoprofile:Algorithmic_Order_Normal']
    privacy = ['uomoprofile:All_but_blocked_users', 'uomoprofile:Followers_Only', 'uomoprofile:Friends_of_a_friend',
               'uomoprofile:Only_Users', 'uomoprofile:Private', 'uomoprofile:Public']
    city = ["Bologna", "New York", "Rome", "Paris", "London", "Madrid", "Utrecht", "Milan", "Berlin", "Ascoli", "Trieste", "Socchieve", "Monserrato"]
    realorder = order[random.randint(0, 4)]
    realprivacy = privacy[random.randint(0, 5)]



    firstname = (random.choice(names))
    lastname = (random.choice(surnames))
    fullname = firstname + " " + lastname
    nickname = firstname + str(random.randint(80, 99))
    newprofile = "https://www.pinterest.it/" + nickname + "/"
    numbers = random.sample(range(0, 12), 4)
    num1 = numbers[0]
    num2 = numbers[1]
    num3 = numbers[2]
    num4 = numbers[3]
    placename = (random.choice(city))

    vanilla_string = vanilla_string.replace('profilelinkhere', newprofile)
    vanilla_string = vanilla_string.replace('fullnamehere', fullname)
    vanilla_string = vanilla_string.replace('nicknamehere', nickname)
    vanilla_string = vanilla_string.replace('numfollowerhere', str(random.randint(100, 300)))
    vanilla_string = vanilla_string.replace('numfollowing', str(random.randint(100, 300)))
    vanilla_string = vanilla_string.replace('fakebio', "hi my name is " + firstname + " and I'm a fake profile made in python :)")
    vanilla_string = vanilla_string.replace('orderhere', realorder)
    vanilla_string = vanilla_string.replace('privacyhere', realprivacy)
    vanilla_string = vanilla_string.replace('containername1', keywordlist[num1])
    vanilla_string = vanilla_string.replace('containername2', keywordlist[num2])
    vanilla_string = vanilla_string.replace('containername3', keywordlist[num3])
    vanilla_string = vanilla_string.replace('containername4', keywordlist[num4])
    vanilla_string = vanilla_string.replace('imagelinkhere', "https://thispersondoesnotexist.com/")
    vanilla_string = vanilla_string.replace('nicknamehere', nickname)
    vanilla_string = vanilla_string.replace('placenamehere', placename)
    risultatoturtle = open("PinterestDataset/"+"pinterest"+ nickname + ".ttl", "w+")
    risultatoturtle.write(vanilla_string)

for i in range(1000):
    pinterest_profile_generator(names, surnames)